answers:
db.patients.aggregate([    { $unwind: "$ENCOUNTERS" },
    { $unwind: "$ENCOUNTERS.MEDICATIONS" },
    { $match: {
        "ENCOUNTERS.MEDICATIONS.DESCRIPTION": "Simvastatin 10 MG Oral Tablet"
    }},
    { $group: {
        _id: "$ENCOUNTERS.MEDICATIONS.DESCRIPTION",
        success_rate: {
            $sum: {
                $cond: [
                    { $eq: [ "$ENCOUNTERS.MEDICATIONS.REASON_CODE", "Success" ] }
                ]
            }
        }
    }},
    { $project: {
        _id: 0,
        medication: "$_id",
        success_rate: { $divide: [ "$success_rate", { $size: "$$ROOT" } ] }
    }}
])

db.CLAIMS.aggregate([
    { $unwind: "$CLAIM_TRANSACTIONS" },
    { $match: {
        "CLAIM_TRANSACTIONS.PAYMENTS": { $exists: true, $not: /Humana/ },
        "CLAIM_TRANSACTIONS.ADJUSTMENTS": { $exists: true, $not: /Humana/ },
        "CLAIM_TRANSACTIONS.OUTSTANDING": { $exists: true, $not: /Humana/ }
    }},
    { $group: { _id: null, count: { $sum: 1 } } },
    { $project: { _id: 0, count: 1 } }
])

db.CLAIMS.aggregate([    { $match: { "HEALTHCARE_CLAIM_TYPE_ID\_1": 1234 } }, // replace 1234 with Medicare's code
    { $unwind: "$CLAIM_TRANSACTIONS" },
    { $match: { "CLAIM_TRANSACTIONS.OUTSTANDING": { $ne: null } } },
    { $group: { _id: null, count: { $sum: 1 } } },
    { $project: { _id: 0 } }
])
